  Sea-Floor Photographs Acquired During U.S. Geological Survey (USGS) Cruise 07034
  (RAFA07034) in the Vicinity of Woods Hole, Offshore Massachusetts (RAFA07034_BOTPHOTOS,
  Geographic)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 10,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
